var jsMinTime=function(){this.startTime=(new Date).getTime(),this.exe=function(t,e,i){var a=(new Date).getTime(),n=Math.max(this.startTime+e-a,0),i=Array.prototype.slice.call(arguments,2);setTimeout(function(){t.apply(null,i)},n)}};